import React, {Component} from 'react';

class Home extends Component {
    constructor(props) {
        super(props);
        this.state={login : false}
    }
    render() {
        if (this.props.login)
        return (
            <div className="data-in-page">
                Home
            </div>
        );
        else
            return (
                <div className="data-in-page"> Login error</div>);
    }
}

export default Home;
